import ContentBlock from './ContentBlock.js';
import Title from './Title.js';
import '../css/Achivements.css';

function AchivementsBlock(props) {
  return (
    <ContentBlock>
      <Title content="Achievements" />
    </ContentBlock>
  );
}

export default AchivementsBlock;
